    var mySite = top.location.hostname;

    dfpFrameElement.width = width;
    dfpFrameElement.height = height;

    /** Fix issues with grey background for google outstream formats **/
    if (position === "inread1") {
      function addStyle(styleString) {
          const style = document.createElement('style');
          style.textContent = styleString;
          dfpFrameElement.contentDocument.head.append(style);
      }

      addStyle(`
        .outer-wrapper.tall.assetless{
            background:none !important;
        }
        .outer-wrapper.wide.assetless{
            background:none !important;
        }`
       );
    }

    /** Fix issues with blanks space for outstream bidders **/
    if (mediaType === "video" && (bidder == "appnexus" || bidder == "spotx")) {
