            top.document.getElementById('wb_container').style.zIndex = 3;
            top.document.getElementById('wb_container').style.margin = "auto";
            top.document.getElementById('wb_container').style.width = "990px";
            top.window.addEventListener('resize', function(ev) {
                if (ev.target.innerWidth < 990) {
                    dfpFrameElement.style.display = 'none';
                    top.document.body.style.paddingTop = "0";
                    top.document.getElementById('wb_container').style.width = "auto";
                } else {
                    dfpFrameElement.style.display = 'block';
                    top.document.body.style.paddingTop = "220px";
                    top.document.getElementById('wb_container').style.width = "990px";
                }
            });
        } else if (/jeuxvideo/.test(mySite)) {
